export async function fetchFirstAid(injury: string) {
  const res = await fetch(`http://localhost:5000/firstaid/${injury}`);
  return await res.json();
}

export async function parseWithAI(input: string) {
  const res = await fetch('/api/parse', {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' },
    body: JSON.stringify({ input }),
  });

  if (!res.ok) {
    throw new Error(`AI parsing failed: ${res.status}`);
  }

  return res.json();
}
